import logo from './logo.svg';
import './App.css';

function App() {

  let captcha = [];

  return (
    <div className="App">
      <header className="App-header">
        Captcha App
      </header>

      <div >
        <form>
          <div class="row">
            <div class="form-group">
              <label for="name">Question: test</label>


            </div>
          </div>
          <div class="row">
            <div class="form-group">
              <button type="submit" class="btn btn-success" style="margin-left:38px">Send</button>
            </div>
          </div>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}

export default App;
